import React from 'react';
import './TaskList.css';

const TaskList = () => {
  return (
    <div className="task-list">
      <h1>Task List</h1>
      <ul>
        <li>Task 1 - Due Tomorrow</li>
        <li>Task 2 - Completed</li>
      </ul>
    </div>
  );
};

export default TaskList;
